
                <!DOCTYPE html><html lang="pt-br"><head><meta charset="UTF-8"><meta name="viewport" content="width=device-width, initial-scale=1.0">
                <title>Rifa - KIT CHURRASCO PREMIUM</title><style>body { font-family: "Open Sans", sans-serif; margin: 0px; padding: 0px; display: flex; height: 100vh; overflow: hidden; background-color: rgb(244, 244, 244); }#panel { width: 350px; background-color: rgb(44, 62, 80); color: rgb(236, 240, 241); padding: 25px; box-shadow: rgba(0, 0, 0, 0.2) 5px 0px 15px; z-index: 10; overflow-y: auto; flex-shrink: 0; display: flex; flex-direction: column; }#panel h2 { font-family: Roboto, sans-serif; font-weight: 700; text-align: center; border-bottom: 2px solid rgb(52, 152, 219); padding-bottom: 10px; margin-top: 0px; }.control-group { margin-bottom: 20px; }.control-group label { display: block; font-weight: bold; margin-bottom: 8px; }.control-group input[type="file"], .control-group textarea { width: 100%; padding: 10px; box-sizing: border-box; border-radius: 5px; border: 1px solid rgb(127, 140, 141); background-color: rgb(52, 73, 94); color: rgb(236, 240, 241); font-family: "Open Sans", sans-serif; }.control-group input[type="file"] { cursor: pointer; }#exportBtn { background-color: rgb(39, 174, 96); color: white; border: none; padding: 15px; font-size: 1.1em; font-weight: bold; border-radius: 5px; cursor: pointer; transition: background-color 0.3s; margin-top: auto; }#exportBtn:hover { background-color: rgb(46, 204, 113); }#preview-container { flex-grow: 1; overflow-y: auto; position: relative; }#preview { font-family: Roboto, sans-serif; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); padding: 20px; background-size: cover; background-position: center center; background-attachment: fixed; min-height: 100%; box-sizing: border-box; }.container { background-color: rgba(255, 255, 255, 0.95); border-radius: 15px; box-shadow: rgba(0, 0, 0, 0.1) 0px 10px 30px; padding: 30px; width: 100%; max-width: 900px; text-align: center; margin: 20px auto; }.header h1 { font-weight: 900; font-size: 3em; color: rgb(231, 76, 60); margin: 0px; text-transform: uppercase; letter-spacing: 2px; }.header h2 { font-size: 1.8em; color: rgb(52, 73, 94); margin: 10px 0px 30px; font-weight: 700; }.prize-details { display: flex; flex-direction: column; gap: 30px; align-items: center; text-align: left; margin-bottom: 30px; }.raffle-image-container { width: 100%; max-width: 600px; }#previewImage { width: 100%; height: auto; border-radius: 10px; box-shadow: rgba(0, 0, 0, 0.2) 0px 8px 25px; background-color: rgb(221, 221, 221); min-height: 250px; object-fit: cover; }.item-list-container { width: 100%; max-width: 600px; background-color: rgb(248, 249, 250); padding: 20px; border-radius: 10px; border-left: 5px solid rgb(231, 76, 60); box-sizing: border-box; }.item-list-container h3 { margin-top: 0px; color: rgb(52, 73, 94); text-align: center; }#previewItemList { list-style-type: "ðŸ¥©"; padding-left: 25px; }#previewItemList li { padding-bottom: 10px; margin-left: 10px; color: rgb(85, 85, 85); }.raffle-section h3 { font-size: 1.5em; color: rgb(44, 62, 80); border-bottom: 2px solid rgb(231, 76, 60); display: inline-block; padding-bottom: 5px; margin-bottom: 25px; }#raffle-grid { display: grid; grid-template-columns: repeat(auto-fill, minmax(90px, 1fr)); gap: 12px; justify-content: center; }.raffle-number { aspect-ratio: 1 / 1; border: 2px solid; border-radius: 8px; display: flex; flex-direction: column; align-items: center; justify-content: center; font-weight: bold; cursor: pointer; transition: 0.3s; padding: 5px; box-sizing: border-box; text-align: center; }.raffle-number .number { font-size: 1.8em; }.raffle-number .name { font-size: 0.7em; font-weight: normal; margin-top: 5px; word-break: break-word; }.available { border-color: rgb(46, 204, 113); background-color: rgb(240, 255, 244); color: rgb(39, 174, 96); }.available:hover { background-color: rgb(212, 248, 225); transform: scale(1.05); }.taken { border-color: rgb(189, 195, 199); background-color: rgb(236, 240, 241); color: rgb(127, 140, 141); cursor: not-allowed; }.taken .number { text-decoration: line-through; }@media (max-width: 1024px) {
  body { flex-direction: column; height: auto; overflow: auto; }
  #panel { width: 100%; box-sizing: border-box; height: auto; border-bottom: 3px solid rgb(52, 152, 219); }
  #preview-container { overflow-y: visible; }
  #preview { background-attachment: scroll; }
